Subtitle:
Банк России 04.04.2024 принял решение зарегистрировать изменения и дополнения в правила доверительного управления паевыми инвестиционными фондами со следующими полными названиями: Биржевой паевой инвестиционный фонд рыночных финансовых инструментов «Облигации в юанях»;Биржевой паевой инвестиционный фонд рыночных финансовых инструментов «Ингосстрах – корпоративные облигации»;
Решение в отношении иных финансовых инструментов
Департамент корпоративных отношений
